import './ExpenseItems.css'
function ExpenseItems(props){
    
   
    return (
    <div className='expense-item'>
    <div>{props.date}</div>
    <h2 >{props.title}</h2>

    <div className='expense-item__description'>
        <div className='expense-item__price'>RS {props.price}</div>
        </div>
        </div>);
}

export default ExpenseItems;
